import Categorie from './Components/Categorie';

function App() {



  return (
    <main>
      <section className="menu section">
        <div className="title">
          <h2>our menu</h2>
          <div className="underline"></div>
        </div>
        <Routes>
          <Route path='/' element={<Menu/>}/> 
          <Route path='/Categorie' element={<Categorie/>}/> 

        </Routes>

      </section>
    </main>

  );
}

export default App;
